// App.js
import React from 'react';
import './App.css';
import Main from './Main';

function App() {
  const products = [
    {
      "title": "Brown eggs",
      "type": "dairy",
      "description": "Raw organic brown eggs in a basket",
      "url": "https://via.placeholder.com/150x150.png?text=Product1",
      "price": 28.1,
      "rating": 4
    },
    {
      "title": "Sweet fresh strawberry",
      "type": "fruit",
      "description": "Sweet fresh strawberry on the wooden table",
      "url": "https://via.placeholder.com/150x150.png?text=Product2",
      "price": 29.45,
      "rating": 4
    }
  ];

  return (
    <div className="App">
      <Main products={products} />
    </div>
  );
}

export default App;
